amage to your opponents','https://mtg.gamepedia.com/Direct_damage',NULL,NULL,'2019-08-25 23:56:44','2019-08-25 23:56:44'),(52,'Necromancy','Bringing Stuff back from the grave','https://mtg.gamepedia.com/Graveyard',NULL,NULL,'2019-08-26 00:16:35','2019-08-26 00:16:35'),(53,'Exile','Excile as much as possible, to prevent graveyard shenanigans ','https://mtg.gamepedia.com/Exile',NULL,NULL,'2019-08-26 00:19:01','2019-08-26 00:19:01'),(54,'Fast Small Creatures (White Weenie)','a flood of low cost white creatures','https://mtg.gamepedia.com/White_Weenie',NULL,NULL,'2019-08-26 00:30:05','2019-08-26 00:30:05');
